from gmpy2 import *
import binascii

e = mpz(3)
n = mpz()
c = mpz(150409620528139732054476072280993764527079006992643377862720337847060335153837950368208902491767027770946661)

i = 0
while True:
    t = iroot((c+i*n), 3)
    if t[1] == True:
        m = t[0]
        break
    i += 1

flag = binascii.unhexlify(hex(m)[2:]).decode('utf-8')
print(flag) # flag{Sm4ll_eee}